import React from "react";
import LinkedInPhoto from "../components/Linkedin_Profile.jpg";

function Home() {
  return (
    <div className="home">
      <h1>Welcome to My Portfolio</h1>
      <p>Hi, I'm Levent! A passionate software developer and designer.</p>
      <img src={LinkedInPhoto}/>
    </div>
  );
}

export default Home;
